import React from "react";
import ProjectsContainer from "../ProjectsContainer";

const Project = props =>{
    const {title,desc,skills} = props;
    return(
        <div>
            {title}
            <div>
                <span>{desc}</span>
                {skills}
            </div>
        </div>
    );
}

export default Project;
